function popUpSetTime(){
    console.log("Hello");
   }

function pipeStatusBox(props) {
  return (
        <div class="bg-white rounded w-full p-2 flex justify-between">
            <h1 className="text-3xl font-bold">{props.name}</h1>
            <label for={"toggle" + props.number} class="flex items-center cursor-pointer" onClick={popUpSetTime}>
                <div class="relative">
                    <input type="checkbox" id={"toggle" + props.number} class="sr-only"/>
                    <div class="box_dot block bg-gray-600 w-14 h-8 rounded-full"></div>
                    <div class="dot absolute left-1 top-1 bg-white w-6 h-6 rounded-full transition"></div>
                </div>
            </label>
        </div> 
  );
}

export default pipeStatusBox;
